  amount :9400, 
  date : new Date(2023, 7, 14) }
];

function App() {
  return (
    <div className="App">
      <h1>App</h1>
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
